// src/components/Header.js
import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css';
import logo from '../assets/images/logo.png';

const Header = ({ isLoggedIn, usfId, onLogout }) => {
    return (
        <header className="header">
            <div className="hamburger" onClick={() => {/* Toggle menu logic here */}}>
                <div className="bar"></div>
                <div className="bar"></div>
                <div className="bar"></div>
            </div>
            <div className="logo">
                <img src={logo} alt="Logo" className="logo-image" />
                <Link to="/">USF, GO BULLS</Link>
            </div>
            <nav className="nav">
                <ul className="nav-links">
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/about">About Us</Link>
                    </li>
                    <li>
                        <Link to="/reserve">Reserve</Link>
                    </li>
                </ul>
            </nav>
            <div className="auth-buttons">
                {isLoggedIn ? (
                    <>
                        <span className="button">{usfId}</span>
                        <button onClick={onLogout} className="button">Logout</button>
                    </>
                ) : (
                    <>
                        <Link to="/login" className="button">Login</Link>
                        <Link to="/register" className="button">Register</Link>
                    </>
                )}
            </div>
        </header>
    );
};

export default Header;
